// App.js
import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Log from './Log';
import Home from './Home'; // Assuming you have a Home component

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" component={Log} />
      </div>
    </Router>
  );
}

export default App;
